  render() {
    return (
      <div className="App">
        {this.state.gatitos.map(cat => {
          return this.printCat();
        })}
      </div>
    );
  }

  printCat = () => {
    return (
      <GetImagen imagen="https://bulma.io/images/placeholders/128x128.png" />
